#!/bin/bash

set +x
set +e

echo "checking for README"
if [ ! -e "./README" ]
then
        echo "Error: No README file"
        exit 1
fi

echo "checking for Makefile"
if [ ! -e "./Makefile" ]
then
        echo "Error: No Makefile file"
        exit 1
fi

echo "Running make"
make
rc=$?
if [ $rc -ne 0 ]
then
        echo "Error when running the make command"
        exit 1
fi

echo "Running make again"
make
rc=$?
if [ $rc -ne 0 ]
then
        echo "Error when running the make command again"
        exit 1
fi

if [ ! -e "./secure_house" ]
then
        echo "Error: Running make did not create the secure_house file"
        exit 1
fi

if [ ! -x "./secure_house" ]
then
        echo "Error: secure_house is not executable"
        exit 1
fi

INPUT_CASE="INSERT KEY david 
TURN KEY david
TURN KEY 
TURN KEY david
ENTER HOUSE 
INSERT KEY david 
TURN KEY david
CHANGE LOCKS hera key key1
ENTER HOUSE david
INSERT KEY pat 
TURN KEY pat
CHANGE LOCKS david key key1
CHANGE LOCKS david kkk kkkk
ENTER HOUSE pat
LEAVE HOUSE david
INSERT KEY david 
TURN KEY david
CHANGE LOCKS  key key1
ENTER HOUSE david
CHANGE LOCKS  k1 k2
CHANGE LOCKS  k1 k2 k3
TURN KEY david
ENTER HOUSE david
INSERT KEY david k1
TURN KEY david
ENTER HOUSE david
CHANGE LOCKS  kk kkk
LEAVE HOUSE 
INSERT KEY david key

"

CORRECT_OUTPUT="KEY  INSERTED BY david
SUCCESS david TURNS KEY 
SUCCESS  TURNS KEY 
SUCCESS david TURNS KEY 
ACCESS ALLOWED
KEY  INSERTED BY david
